<script>
(function () {
  function sendSize() {
    var h = Math.max(
      document.documentElement.offsetHeight,
      document.body ? document.body.offsetHeight : 0,
      document.documentElement.scrollHeight
    );
    window.parent.postMessage({ type: 'menuSize', height: h }, '*');
  }

  window.addEventListener('load', function () {
    sendSize();
    requestAnimationFrame(function () {
      setTimeout(function () {
        sendSize();
        window.parent.postMessage({ type: 'menuReady' }, '*');
      }, 600); // bump if your animations run longer
    });
  });

  window.addEventListener('message', function (e) {
    if (e.data && e.data.type === 'requestMenuSize') sendSize();
  });

  if ('ResizeObserver' in window) {
    var ro = new ResizeObserver(sendSize);
    ro.observe(document.documentElement);
    if (document.body) ro.observe(document.body);
  }
})();
</script>

<script>
(function () {
  // Delegate clicks anywhere inside a group having data-nav
  document.addEventListener('click', (e) => {
    const group = e.target.closest('[data-nav]');
    if (!group) return;
    const target = group.getAttribute('data-nav');
    if (!target) return;

    // Send a message to the parent (sandbox-safe)
    window.parent.postMessage({ type: 'lab-nav', target }, '*');
  });
})();
</script>
